import homepageImg from "./assets/homepage.jpeg";

function HomePage() {
  return (
    <div>
        <main>
            <section>
                <h1>Have Gift ideas for this Xmas</h1>
            </section>

            <section>
                <img src={homepageImg} alt=""/>
                <div>borda preta</div>
                <div>linha vermelha</div>
            </section>

        </main>
      <h2>HomePage - Initial commit</h2>
    </div>
  );
}

export default HomePage;
